import React from "react"

const data = ["https://picsum.photos/200/300", "https://picsum.photos/200/200", "https://picsum.photos/200/300", "https://picsum.photos/300/200", "https://picsum.photos/200/400"]

const Photo = (props) => {
    return(
        <img alt="" src={data[props.index]}/>
    )
}


export default function Gallery(){
    console.log("wsh alors")
    return(
        <div>
            <img alt="" src={data[0]}></img>
            <ul>
            {
                data.map((photo, index) => {
                    return(
                        <Photo index={index}/>
                    )
                })
            }   
            </ul>

        </div>
    )
}
